sys_variable_value.value:
(function execute(inputs, outputs) {

    var taskUtils = new TaskUtils();
    var task = taskUtils.fetchAllTaskDetails(inputs.task_id);

    if (task) {
        outputs.name = task.task_name;
        outputs.due_date = task.task_due_date;
        outputs.status = task.task_status;
        outputs.assigned_to = task.task_assigned_to;
    } else {
        outputs.name = '';
        outputs.due_date = '';
        outputs.status = '';
        outputs.assigned_to = '';
    }
})(inputs, outputs);

